import React from "react";
import "./Contact.css";

function Contact() {
  const contactInfo = [
    {
      name: "Email",
      value: "yourname@example.com",
      icon: "ðŸ“§", // using emoji since devicon doesn't have email
      link: "mailto:yourname@example.com",
    },
    {
      name: "GitHub",
      value: "https://github.com/talha-xml",
      icon: <i className="devicon-github-original"></i>,
      link: "https://github.com/talha-xml",
    },
    {
      name: "LinkedIn",
      value: "https://www.linkedin.com/in/talha-faizan-46158532a/",
      icon: <i className="devicon-linkedin-plain colored"></i>,
      link: "https://www.linkedin.com/in/talha-faizan-46158532a/",
    },
  ];

  return (
    <div className="contact-page">
      <div className="contact-container">
        <h1>Contact Me ðŸ“¥</h1>
        {contactInfo.map((item, index) => (
          <p key={index}>
            <strong>
              {item.icon} {item.name}:
            </strong>{" "}
            {item.link ? (
              <a
                href={item.link}
                target="_blank"
                rel="noopener noreferrer"
              >
                {item.value}
              </a>
            ) : (
              item.value
            )}
          </p>
        ))}
      </div>
    </div>
  );
}

export default Contact;
